import React, {useState} from 'react';
import {Link} from 'react-router-dom';

function Menu() {
  return (
    <>
    <nav className = 'menu'>
       <div className = 'menu-kontener'>
        <Link to='/' className = 'menu-logo'>
            MENU  <i className= 'fab fa-typo3' />
            </Link>  
        </div>
    </nav>
    </>
  )
}

export default Menu;
